import Layout from '../../layout/layouts';
import Link from 'next/link';



    class Pembayaran extends React.Component{
        constructor (props){
            super(props);
        }
    render(){
        return(
                <Layout>
                <div class="bayar">
                <center>
                <div class="form">
                    <div class="input_text">
                        <span>Nama</span><br/>
                        <input type="text"/>
                    </div>
                    <div class="input_text">
                        <span>E-mail</span><br/>
                        <input type="text"/>
                    </div>
                    <div class="input_text">
                        <span>Jumlah Tiket</span><br/>
                        <input type="number"/>
                    </div>
                    <div class="select">
                        <span>Pembayaran</span><br/>
                        <select class="type_bayar">
                            <option value="">BCA</option>
                            <option value="">BRI</option>
                            <option value="">BNI</option>
                            <option value="">MANDIRI</option>
                            <option value="">BANK JATIM</option>
                        </select>
                    </div>
                    <div class="input_button">
                    <div class="cancel">
                    <Tombol class="b1" link="/index" txt="cancel" />
                      </div>
                      <Nav/>
                    </div>
                </div></center>
                </div>  </Layout>
            )
        }
        }
          
        



        function Tombol(props){
            return(
            <div class={props.class}><Link href={props.link}> <a>{props.txt}</a></Link></div> 
            )
        }

        export default Pembayaran;
